import React from 'react';
import Link from 'next/link';
import { Header, HeaderNav, HeaderLink, HeaderItem } from './Navigation.styled';

const Navigation = (): JSX.Element => {
    return (
        <Header>
            <Link href="/">
                <a>Your Posts</a>
            </Link>
            <Link href="/posts/new">
                <a>Add Post</a>
            </Link>
        </Header>
    );
};

export default Navigation;
